import{_ as e,c as t,o as r,ae as s}from"./chunks/framework.B8KKhRA6.js";const c="/web/echartsLineStack.png",b=JSON.parse('{"title":"echarts的折线图的y轴刻度值与图表渲染不一致的BUG","description":"","frontmatter":{"title":"echarts的折线图的y轴刻度值与图表渲染不一致的BUG","author":"刘军","location":"武汉","date":"2024-12-10T00:00:00.000Z"},"headers":[],"relativePath":"web/javascript/echartsLineStack.md","filePath":"web/javascript/echartsLineStack.md","lastUpdated":1734073417000}'),i={name:"web/javascript/echartsLineStack.md"};function n(h,a,o,l,d,p){return r(),t("div",null,a[0]||(a[0]=[s('<h1 id="echarts的折线图的y轴刻度值与图表渲染不一致的bug" tabindex="-1">echarts的折线图的y轴刻度值与图表渲染不一致的BUG <a class="header-anchor" href="#echarts的折线图的y轴刻度值与图表渲染不一致的bug" aria-label="Permalink to &quot;echarts的折线图的y轴刻度值与图表渲染不一致的BUG&quot;">​</a></h1><h3 id="问题描述" tabindex="-1">问题描述 <a class="header-anchor" href="#问题描述" aria-label="Permalink to &quot;问题描述&quot;">​</a></h3><p>在做echarts图表的开发时，发现折线图的数值和y轴的高度对不上。上网查询资料后，发现是stack的原因。 <img src="'+c+'" alt="折线图的y轴刻度值与图表渲染不一致效果图"></p><h3 id="原因分析" tabindex="-1">原因分析 <a class="header-anchor" href="#原因分析" aria-label="Permalink to &quot;原因分析&quot;">​</a></h3><p>stack：数据堆叠，同个类目轴上系列配置相同的 stack 值可以堆叠放置。就像柱形图表现的那样，后一个值是叠加到前一个值上面的。故出现线和值对不上的情况。</p><h3 id="解决方案" tabindex="-1">解决方案 <a class="header-anchor" href="#解决方案" aria-label="Permalink to &quot;解决方案&quot;">​</a></h3><p>解决方案1:<br> 将series中的“stack”属性删除</p><p>解决方案2:<br> 将series中的“stack”属性名称改为不一致</p><h3 id="参考链接" tabindex="-1">参考链接 <a class="header-anchor" href="#参考链接" aria-label="Permalink to &quot;参考链接&quot;">​</a></h3><p><a href="https://blog.csdn.net/weixin_45586038/article/details/127304809" target="_blank" rel="noreferrer">解决Echarts折线图y轴刻度的值跟实际值不对应的问题</a><br><a href="https://blog.csdn.net/Wjhsmart/article/details/128898833" target="_blank" rel="noreferrer">解决Echarts折线图的y轴刻度值与图表渲染不一致的BUG</a></p>',10)]))}const k=e(i,[["render",n]]);export{b as __pageData,k as default};
